import { Component, Inject, ViewContainerRef, OnInit, ViewChild, ComponentFactoryResolver, ElementRef } from '@angular/core';
import { AppendServiceService } from '../_services/append-service.service';
import { MoskitieraFormularzComponent } from '../moskitiera-formularz/moskitiera-formularz.component';
import { AlertifyService } from '../_services/alertify.service';
import * as jsPDF from 'jspdf';
import 'jspdf-autotable';

@Component({
  selector: 'app-moskitiery',
  templateUrl: './moskitiery.component.html',
  styleUrls: ['./moskitiery.component.css']
})
export class MoskitieryComponent implements OnInit {
  @ViewChild('dynamicComponentContainer', { read: ViewContainerRef }) dynamicComponentContainer;
  @ViewChild('moskitiery') moskitiery: ElementRef;
  components = [];
  sum: number;

  constructor(private componentFactoryResolver: ComponentFactoryResolver, private viewContainerRef: ViewContainerRef, private appendService: AppendServiceService, private alertify: AlertifyService) {
  }


  ngOnInit() {
    this.appendService.currentSum.subscribe(sum => this.sum = sum);
  }

  addRow() {
    const factory = this.componentFactoryResolver.resolveComponentFactory(MoskitieraFormularzComponent);
    const componentRef = this.dynamicComponentContainer.createComponent(factory);
    componentRef.changeDetectorRef.detectChanges();
    this.components.push(componentRef);
  }

  removeRow() {
    const componentIndex = this.components.length - 1;
    const component = this.components[componentIndex];

    if (componentIndex !== -1) {
      this.dynamicComponentContainer.remove(componentIndex);
      this.components.splice(componentIndex, 1);
      // this.appendService.sumUp(-component.actualPrice)
    } else {
      this.alertify.error("Nie możesz usunąć więcej wierszy");
    }
  }

  downloadPricing() {
    //dokumentacja jsPDF https://parall.ax/products/jspdf 
    let doc = new jsPDF('landscape');
    let logoData = 'data:image/png;base64,'
    doc.addImage(logoData, 'JPEG', 5, 5, 54, 16) //padding góra, lewo | szerokość, wysokość
    doc.setFontSize(22);
    doc.text(110, 32, 'Wycena dla producenta');

    // doc.setFontSize(20);
    // doc.text(200, 50, 'Razem do zaplaty: ' + this.sum.toFixed(2) + 'zl');
    let orderContent = this.getOrderContent();

    doc.setFontSize(16);
    doc.autoTable({
      margin: { top: 40 },
      theme: 'grid',
      headStyles: { fillColor: [26, 26, 26] },
      head: [['Lp.', 'Szerokosc', 'Wysokosc', 'Naroznik wew.', 'Kolor obudowy', 'Kolor siatki', 'Uchwyt montazowy', 'Grubosc felca', 'Ilosc', 'Koszt']],
      body: orderContent,
      footStyles: { fontSize: 17, fillColor: [255, 255, 255], textColor: [0, 0, 0] },
      foot: [['', '', '', '', '', '', '', '', 'Razem:', this.sum.toFixed(2) + 'zl']]
    })

    doc.save('test.pdf');
  }

  getOrderContent() {
    const orderContent = [];
    let pricingDetails;
    let formsArray = document.getElementsByClassName("form");
    let currentForm;
    let width, height, cornerConnector = false, casingColor, netColor, handler = 'Sprezynki', thickness = '0cm', amount = 1, price;
    let tempThickness, tempAmount;

    for (let i = 0; i < formsArray.length; i++) {
      currentForm = formsArray[i];
      price = currentForm.getElementsByClassName("price")[0].innerHTML + 'zl';

      if (price != '0.00') {
        //process each form
        width = currentForm.getElementsByClassName("width")[0].value + 'cm';
        height = currentForm.getElementsByClassName("height")[0].value + 'cm';
        cornerConnector = currentForm.getElementsByClassName("cornerConnector")[0].checked;
        casingColor = currentForm.getElementsByClassName("casing-color-option selected")[0].title;
        netColor = currentForm.getElementsByClassName("net-color-option selected")[0].title;
        handler = currentForm.getElementsByClassName("handler")[0].value;
        tempThickness = currentForm.getElementsByClassName("thickness")[0];
        thickness = (tempThickness.value ? tempThickness.value + 'cm' : 'Brak');
        amount = currentForm.getElementsByClassName("amount")[0].value;

        //push row to order array
        pricingDetails = [i + 1, width, height, cornerConnector, casingColor, netColor, handler, thickness, amount, price];
        orderContent.push(pricingDetails);
      }
    }
    return orderContent;
  }
}
